import React from 'react';

const App = () => {
  const [count, setCount] = use
  return (
    <div className="App">
      <h1>Вы нажали {count} раз</h1>
      <button
        onClick={() => setCount(count + 1)}>
        НАжми на меня
      </button>
    </div>
  );
}

export default App;
